INSERT INTO public.stories (id, owner_user_id, child_name, child_age, child_gender, words_used, main_character_description, sections, status, created_at, updated_at, avatar_url, child_id, story_length_minutes, image_scene_count, book_id, raw_prompt, raw_response, generation_logs, error_message) VALUES
('13c6b3e3-5692-41ed-bda3-f79d5015bb77', 'f6e5e1cf-ab1e-4c7a-b4ef-b0afff7ec61c', NULL, NULL, NULL, NULL, 'A 5-year-old boy with short, sandy brown hair and bright blue eyes, wearing a bright red t-shirt and blue shorts.', '[{"text":"Rain was playing in his backyard, gazing up at the clouds. One cloud looked exactly like a fluffy sheep! Suddenly, the sheep cloud winked! It floated gently down, right in front of Rain. \"Hop on!\" a voice whispered. Rain, wide-eyed with wonder, climbed onto its soft, woolly back.","image_prompt":"[1] is looking up at a fluffy sheep-shaped cloud as it floats down to him in his backyard.","after_word_index":47},{"text":"The sheep cloud soared into the sky, carrying Rain on a magical adventure. They flew over fields of bright yellow sunflowers and sparkling blue rivers. Rain laughed as the sheep cloud did loop-de-loops in the sky. Then, the sheep cloud zoomed toward a giant rainbow, which turned out to be a slide! Rain whooshed down, landing softly on a pile of sweet cotton candy clouds.","image_prompt":"[1] is sliding down a rainbow and landing on cotton candy clouds while riding a sheep-shaped cloud.","after_word_index":112}]', 'completed', '2026-01-08T05:39:35.436093+00:00', '2026-01-08T05:39:56.73694+00:00', 'f6e5e1cf-ab1e-4c7a-b4ef-b0afff7ec61c/avatars/c7bf5520-50ed-4692-b832-a8e5cd44e954/1767850764162.png', 'c7bf5520-50ed-4692-b832-a8e5cd44e954', NULL, NULL, NULL, NULL, NULL, '[]', NULL)
